```
^\D*(\d+)
```

Explanation:

*   `^` asserts the start of the line.
*   `\D*` matches any non-digit character (including spaces, punctuation, etc.) 0 or more times.
*   `(\d+)` captures one or more digits into group 1.

Here is an example of how to use it in JavaScript:

```javascript
const regex = /^\D*(\d+)/;
const string = "abc123def456";
const match = string.match(regex);

if (match) {
    console.log(match[1]); // outputs: "123"
} else {
    console.log("No match found.");
}
```

