func main() {
    pc, err := net.ListenUDP("udp", &net.UDPAddr{Port: 53})
    if err != nil {
        log.Fatal(err)
    }
    defer pc.Close()

    handler := dns.HandlerFunc(func(w dns.ResponseWriter, r *dns.Msg) {
        msg := dns.Msg{}
        msg.RecursionDesired = true
        msg.Id = r.Id
        msg.Qdcount = r.Qdcount
        msg.Ancount = r.Ancount
        msg.Nscount = r.Nscount
        msg.Arcount = r.Arcount
        msg.Qd = r.Qd

        for _, q := range r.Qd {
            msg.Answer = append(msg.Answer, &dns.RR_Header{Name: q.Name, Rrtype: dns.TypeA, Class: dns.ClassINET, Ttl: 0})
        }

        w.WriteMsg(&msg)
    })

    server := &dns.Server{Addr: ":53", Net: "udp", Handler: handler}
    log.Fatal(server.ListenAndServe())
}
```

